import React, { useEffect, useRef, useState } from "react";
import Axios from "axios";
import { Menu, MenuItem, Dialog, DialogContent, IconButton, Button, Container, CssBaseline, Typography, Paper, ThemeProvider } from '@mui/material';
import { styled } from '@mui/system';
import CloseIcon from '@mui/icons-material/Close';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api'; 
import { useNavigate } from 'react-router-dom';

import theme from './Theme/theme';
import logo from './Theme/images/baselogo.jpg';
import walkway0 from './Theme/images/walkway_0.jpg';
import walkway1 from './Theme/images/walkway_1.jpg';
import walkway2 from './Theme/images/walkway_2.jpg';
import walkway3 from './Theme/images/walkway_3.jpg';
/* global google */

// Styled components using MUI's new styled API
const AppContainer = styled(Container)(({ theme }) => ({
  ...theme.root,
  zIndex: 9999,
}));

const Logo = styled('img')(({ theme }) => ({
  position: 'absolute',
  top: theme.spacing(2),
  left: theme.spacing(50),
  width: '200px',
  height: 'auto',
  cursor: 'pointer',
}));

const MapContainer = styled(Paper)(({ theme }) => ({
  height: '600px',
  width: '100%',
  marginTop: theme.spacing(4),
}));

const LogoutButton = styled(Button)(({ theme }) => ({
  position: 'absolute',
  right: 100,
  top: 20,
}));

const MoreMenuButton = styled(IconButton)(({ theme }) => ({
  position: 'absolute',
  right: 20,
  top: 20,
}));

const DialogTitleContainer = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
});

const WalkerBoard = ({ onLogout }) => {
  const [error, setError] = useState(null);
  const [anchorEl, setAnchorEl] = useState(null);
  const [success, setSuccess] = useState(null);
  const [markers, setMarkers] = useState([]);
  const [selectedMarker, setSelectedMarker] = useState(null);
  const mapRef = useRef(null);
  const placesServiceRef = useRef(null); // Reference for PlacesService

  const navigate = useNavigate();
  const imageMap = {
    0: walkway0,
    1: walkway1,
    2: walkway2,
    3: walkway3,
  };

  // Handle Logout
  const handleLogOut = async () => {
    setError(null);
    setSuccess(null);

    try {
      await Axios.get("http://localhost:8080/logout");
      if (onLogout) {
        onLogout();
      }

      setSuccess('Log out successful!');
      navigate('/App');
    } catch (error) {
      setError('Log out failed: ' + error.message);
    }
  };

  const mapStyles = {
    height: '100%',
    width: '100%',
  };

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleLogoClick = () => {
    navigate('/WalkerBoard');
  };

  const handleCloseDialog = () => {
    setSelectedMarker(null);
  };

  // Function to initialize the PlacesService and search for nearby places or specific places
  const onLoadMap = (map) => {
    mapRef.current = map;

    const request = {
      location: new google.maps.LatLng(41.5564, -8.16415), // Starting point
      radius: '500', // Search radius in meters
      type: ['park'], // Search for places of type 'park', for example
    };

    // Initialize the PlacesService
    placesServiceRef.current = new google.maps.places.PlacesService(map);

    // Perform a nearby search based on the request
    placesServiceRef.current.nearbySearch(request, (results, status) => {
      if (status === google.maps.places.PlacesServiceStatus.OK) {
        const placeMarkers = results.map((place) => ({
          id: place.place_id,
          name: place.name,
          coordinates: {
            latitude: place.geometry.location.lat(),
            longitude: place.geometry.location.lng(),
          },
          district: place.vicinity,
          description: place.types.join(', '), // Join types as description
        }));
        setMarkers(placeMarkers); // Set markers based on place data
      } else {
        console.error("Places search failed: ", status);
        setError("Failed to retrieve places.");
      }
    });
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppContainer>
        <Logo src={logo} alt="logo" onClick={handleLogoClick} />

        <MoreMenuButton
          aria-label="more"
          aria-controls="long-menu"
          aria-haspopup="true"
          onClick={handleClick}
        >
        <MoreVertIcon />
        </MoreMenuButton>

        <Menu
          id="long-menu"
          anchorEl={anchorEl}
          keepMounted
          open={Boolean(anchorEl)}
          onClose={handleClose}
          slotProps={{
            paper: {
              style: {
                maxHeight: 48 * 4.5,
                width: '20ch',
              },
            },
          }}
        >
          <MenuItem onClick={() => { handleClose(); navigate('/Profile'); }}>
            Profile
          </MenuItem>
          <MenuItem onClick={() => { handleClose(); navigate('/History'); }}>
            History
          </MenuItem>
          <MenuItem onClick={() => { handleClose(); navigate('/Settings'); }}>
            Settings
          </MenuItem>
        </Menu>

        <MapContainer>
          <LoadScript
            googleMapsApiKey="AIzaSyC8Sj12_rv73anPhi2oCeqsVVjUkfFJ4-U" // Replace with your real API Key
            libraries={['places']} // Include the Places library
            async
          >
            <GoogleMap
              mapContainerStyle={mapStyles}
              zoom={10}
              center={{ lat: 41.5564, lng: -8.16415 }}
              mapTypeId="terrain" 
              onLoad={onLoadMap}
            >
              {markers.map((marker) => (
                <Marker
                  key={marker.id}
                  position={{ lat: marker.coordinates.latitude, lng: marker.coordinates.longitude }}
                  title={marker.name}
                  onClick={() => setSelectedMarker(marker)}
                />
              ))}
            </GoogleMap>
          </LoadScript>
        </MapContainer>

        <Dialog
          open={selectedMarker !== null}
          onClose={handleCloseDialog}
          aria-labelledby="marker-details-title"
          fullWidth
        >
          <DialogTitleContainer>
            <Typography>{selectedMarker?.name}</Typography>
            <IconButton aria-label="close" onClick={handleCloseDialog}>
              <CloseIcon />
            </IconButton>
          </DialogTitleContainer>
          <DialogContent dividers>
            <Typography gutterBottom>District: {selectedMarker?.district}</Typography>
            <Typography gutterBottom>Description: {selectedMarker?.description}</Typography>
          </DialogContent>
        </Dialog>

        <LogoutButton variant="contained" color="secondary" onClick={handleLogOut}>
          Logout
        </LogoutButton>
      </AppContainer>
    </ThemeProvider>
  );
};

export default WalkerBoard;
